#!/bin/sh
#
# installation script
# for JavaProp
#
more << "EODOC"
This is an installation script.

It will create a directory
MH-AeroTools/JavaProp
in your home directory and install the.
JavaProp application there.

You can then run JavaProp by executing
the shell script JavaProp.sh.

Do you want to continue (y or n)?
EODOC
read cont
case $cont in
  y* | Y*)
echo ;;
  *)
echo Installation aborted
exit 1 ;;
esac
if ! test -x `which uudecode`; then
echo Oops: uudecode utility not found.;
echo You will have to install it;
echo e.g. by installing sharutils.;
exit;
fi
if ! test -x `which gunzip`; then
echo Oops: gunzip utility not found.;
echo You will have to install it;
echo to uncompress this installer.;
exit;
fi
if ! test -x `which tar`; then
echo Oops: tar utility not found.;
echo You will have to install it;
echo to run this installer.;
exit;
fi
mkdir ~/MH-AeroTools
mkdir ~/MH-AeroTools/JavaProp
cd ~/MH-AeroTools/JavaProp
cat << "EOI" > JavaProp.Archive.tar.gz.uue
begin 666 JavaProp.Archive.tar.gz
